  true,\n\t\"url\": null,\n\t\"notes\": \"The Federal Advisory Committee Act (FACA)
  database is used by Federal agencies to continuously manage an average of 1,000
  advisory committees government-wide. This database is also used by the Congress
  to perform oversight of related Executive Branch programs and by the public, the
  media, and others, to stay abreast of important developments resulting from advisory
  committee activities.  Although centrally supported by the General Services Administration's
  (GSA) Committee Management Secretariat, the database represents a true shared system
  wherein each participating agency and individual committee manager has responsibility
  for providing accurate and timely information that may be used to assure that the
  system's wide array of users has access to data required by FACA.\",\n\t\"license_title\":
